import React from 'react';
import logo from './logo.svg';
import './App.css';
import TodoListHeader from './TodoListHeader';

function App() {
  const todoList=[
    'First',
    'break'
  ];


  return (
    <div className="App">
      <h2>Todo List</h2>
      <TodoListHeader/>
      {
        todoList.map(item=> <p>{item}</p>)
      }
    </div>
  );
}

export default App;
